function parseUri(uri){
	var data = uri.split("&");
	var result = {};
	if(uri.length < 1) { return result; };
	for(elt of data){
		elt = elt.split("=");
		if(elt[1] == "true" || elt[1] == "false"){
			result[elt[0]] = (elt[1] == "true");
		} else {
			result[elt[0]] = Number(elt[1]);
		}
	}
	return result;
}

